        return(
            <div>
            <form >
           <label name="name">Name</label>
              <input name="name" />

              <br />
              <p>
              <label name="description">Description</label>
              <textarea name="description" type='text'/>
              <br />
              <br />
              <select>
                  {this.props.specialties.map( specialty =>  <option value="volvo">{specialty}</option>)

                  }
            </select>
            <br />
            <br />
               <button>Create Task!</button>
            </p>
            </form>
          </div>
    )
    }
}    
